import React, { Component } from "react";

import { Grid , Cell } from 'react-mdl';
class Resume extends Component {
	render(){
		return (

			<div> 
			<Grid>


				<Cell col = {4}> Left Side 

				<div style={{textAlign:'center'}}>

					<img src ="https://scontent.fykz1-1.fna.fbcdn.net/v/t1.0-9/65636509_10157601580238846_4506839862367748096_n.jpg?_nc_cat=104&_nc_oc=AQkujWeQnI9orlYYc3vySfIHBr38SHYKDpMz5IHGtFVAtsdgSJ3J7IPN5Cb5AmdgkS0&_nc_ht=scontent.fykz1-1.fna&oh=d29bd59b63d97f164360449b875c7873&oe=5DCDD4EA"
						style={{height: '250px'}}
						/>


				</div>

				<h2 style={{paddingTop: '2em'}}> Paritosh Arya </h2>
				
				<h4 style={{color:'grey'}}> I am a programmer </h4>
				
				<hr style={{borderTop: '3px solid #833fb2' , width: '50%'}} />
				
				<p> Computer Engineering graduate from Queen’s University. Brings a diversified portfolio of data analysis, product design and database management. Actively pursues exploring new API’s and other open source projects. Adapts to change and learns new skills quickly. Enjoys working in a team environment and discussing technical subjects with peers.</p>
				
				<hr style={{borderTop: '3px solid #833fb2' , width: '50%'}} />

				<h7> Updated in 2019</h7>
				</Cell>


				<Cell className="resume-right" col = {8}> Right Side </Cell>


			</Grid>


			</div>
			)

	};
}

export default Resume;
